\c postgres;

CREATE SCHEMA IF NOT EXISTS supos;


CREATE TABLE IF NOT EXISTS "supos"."supos_resource" (
"id" BIGSERIAL PRIMARY KEY,
"parent_id" int8,
"type" int2,
"source" varchar(256) DEFAULT 'platform',
"code" varchar(256) COLLATE "pg_catalog"."default",
"name_code" varchar(256) COLLATE "pg_catalog"."default",
"route_source" int2,
"url" varchar(512) COLLATE "pg_catalog"."default",
"url_type" int2 DEFAULT '1'::smallint,
"open_type" int2 DEFAULT '0'::smallint,
"icon" varchar(512) COLLATE "pg_catalog"."default" DEFAULT NULL::character varying,
"description_code" varchar(512) COLLATE "pg_catalog"."default" DEFAULT NULL::character varying,
"sort" int4 DEFAULT '0',
"edit_enable" bool DEFAULT true,
"home_enable" bool DEFAULT true,
"fixed" bool DEFAULT false,
"enable" bool DEFAULT true,
"update_at" timestamptz(6) DEFAULT now(),
"create_at" timestamptz(6) DEFAULT now()
);

